const About = () => {
    return ( 
        <div className="about">
            <h4>What is Vegan Recipe Finder?</h4>
            <p>As a vegan who has a terrible tendency of purchasing groceries only to let them rot in the refrigerator, I realized I had a need for an app that will help me to come up with a recipe for my expiring groceries.
                This is where Vegan Recipe Finder comes in to play!  Simple type in the ingredient(s) you have sitting around in your kitchen, and the app will pull in recipe data and present you options to make with what you have.
            </p>
        </div>
     );
}

export default About;
